/**
Implement wildcard pattern matching with support for '?' and '*'.

'?' Matches any single character.
'*' Matches any sequence of characters (including the empty sequence).

The matching should cover the entire input string (not partial).

The function prototype should be:
bool isMatch(const char *s, const char *p)

Some examples:
isMatch("aa","a") → false
isMatch("aa","aa") → true
isMatch("aaa","aa") → false
isMatch("aa", "*") → true
isMatch("aa", "a*") → true
isMatch("ab", "?*") → true
isMatch("aab", "c*a*b") → false
*/
#include <iostream>
#include <string>
#include <unordered_map>
#include <vector>

using namespace std;


class Solution {
public:
    bool isMatch(string s, string p) {
        //p = move(simplify(p));
        vector<bool> tb(s.size()+1, true);
        int plen = p.length(), slen = s.length();
        for (int i=0; i<plen; ++i) {
            if (p[i] == '*') {
                int j = 1;
                while (j <= slen) {
                    if (tb[j]) {
                        break;
                    }
                    ++j;
                }
                while (j <= slen) {
                    tb[j] = true;
                    ++j;
                }
            } else {
                for (int j=slen-1; j>=0; --j) {
                    tb[j+1] = tb[j] && (p[i] == s[j-1] || p[i] == '?');
                }
            }
        }
        return tb[slen];
    }

private:

    inline string simplify(const string &s) {
        string result;
        char prev = 0;
        for (int i=0; i<s.length(); ++i) {
            if (s[i] == '*' && prev!='*') {
                prev = '*';
                result.push_back(s[i]);
            } else if (s[i] != '*') {
                prev = s[i];
                result.push_back(s[i]);
            }
        }
        return result;
    }
};

int main()
{
    Solution s;
    cout << s.isMatch("abbaabbbbababaababababbabbbaaaabbbbaaabbbabaabbbbbabbbbabbabbaaabaaaabbbbbbaaabbabbbbababbbaaabbabbabb", "***b**a*a*b***b*a*b*bbb**baa*bba**b**bb***b*a*aab*a**") << endl;
    cout << s.isMatch("", "**") << endl;
    cout << s.isMatch("bababbbbabaabbabbabbabbabbbaabbbabbbababaabbbbaabababaababbabbbbabaaaabaaaaabaabaabaabbabaaababbbbabbbbbabbbaaaaabaabbbaababbbbaabbbabaaaaaaaabaababbbbbbbaaabbaaabbbbbabbababbabababababbbbbabbaaaabaab", "b*a*aabb**bb*aa*b*a*bb*bb*b*ab**a*ba**bab**a****ba**ba***b***ab****bb*b*b***b****baaba**bb**b****aa*a**") << endl;
    cout << s.isMatch("a", "aa") << endl;
    return 0;
}
